      canvas.selectElement(elementSelector).then(function () {
        conditionalVisibilitySettings = workspace.getRightPanel().clickPropertiesTab().conditionalVisibilitySettings; // add a placeholder passing condition

        conditionalVisibilitySettings.addCondition({
          name: 'Name',
          operator: 'Does Not Equal',
          value: 'PLACEHOLDER'
        });
      });
    }

function saveSnapshots () {
    if (storeSnapshot) {
      const snapshots = storeSnapshot()
      console.log('%d snapshot(s) on finish', countSnapshots(snapshots))
      console.log(snapshots)

      snapshots.__version = Cypress.version
      const s = JSON.stringify(snapshots, null, 2)
      const str = `module.exports = ${s}\n`
      cy.writeFile(SNAPSHOT_FILENAME, str, 'utf-8', { log: false })
    }
  }

