function loadSnapshots () {
    cy
    .readFile(SNAPSHOT_FILENAME, 'utf-8', { log: false })
    .then(evaluateLoadedSnapShots)
    // no way to catch an error yet
  }

function () {
  // Unit tests do not require registration
  if (!Cypress.env('unit')) {
    _cypressAppControls.api.registerDefaultUserIfNeeded();
  }
}

function () {
    _cypressAppControls.api.upgradePlan();

    workspace = _cypressAppControls.api.importSnapshot(_cypressAppControls.snapshots.Dynamo.dynamicContentComplexity);
    canvas = workspace.getCanvas();
    workspace.getLeftSidebar().clickPagesTab().switchPage('Limit Setting Changes');
  }

function () {
    waitUntilNotificationsHaveCleared().then(function () {
      return canvas.selectElement('.w-dyn-items').then(function () {
        limitSettings = workspace.getRightPanel().clickPropertiesTab().collectionListSettings.createLimitSettings();
        return limitSettings.getShownItemsInput().should('exist');
      });
    });
  }

function saveSnapshots () {
    if (storeSnapshot) {
      const snapshots = storeSnapshot()
      console.log('%d snapshot(s) on finish', countSnapshots(snapshots))
      console.log(snapshots)

      snapshots.__version = Cypress.version
